import { useSelector } from "react-redux";
import { Header } from "../../components/header/header";
import { NavBar } from "../../components/navBar/navBar";
import { Tech } from "../../components/techs/techs";

export const Home = () => {
  const state: any = useSelector((state) => state);
  return (
    <>
      <NavBar />
      <Header />
      <Tech />
    </>
  );
};
